prompt Creating AREACODEFULL...
create table AREACODEFULL
(
  citycode VARCHAR2(20) not null,
  cityname VARCHAR2(100),
  operator VARCHAR2(50),
  makedate DATE,
  maketime VARCHAR2(50),
  bak1     VARCHAR2(50),
  bak2     VARCHAR2(50),
  bak3     VARCHAR2(50)
)
;
