  add constraint PK_AREACODEFULL primary key (CITYCODE);

prompt Creating CITY...
create table CITY
(
  cityid     NUMBER(5) not null,
  cityname   VARCHAR2(50),
  zipcode    VARCHAR2(50),
  provinceid NUMBER(5)
)
;
alter table CITY
  add primary key (CITYID);
alter table CITY
  add constraint FOR_PROVINCEID foreign key (PROVINCEID)
  references PROVINCE (PROVINCEID) on delete cascade;

prompt Creating COMPANYNAME...
